        "learning": MessageLookupByLibrary.simpleMessage("Éducation"),
        "learningA1": MessageLookupByLibrary.simpleMessage(
            "Votre enfant peut s\'inscrire à l\'école par le biais du système éducatif officiel, qui comprend les écoles gouvernementales, les écoles privées et les écoles internationales supervisées par le ministère de l\'Éducation. L\'éducation gouvernementale est actuellement disponible pour les réfugiés et les demandeurs d\'asile du Soudan, du Soudan du Sud, du Yémen et de la Syrie sur un pied d\'égalité avec les Égyptiens, et la Commission travaille avec le gouvernement pour intégrer d\'autres nationalités de réfugiés également."),
        "learningA10": MessageLookupByLibrary.simpleMessage(
            "Oui, le HCR fournit des subventions éducatives pour les enfants en âge scolaire réfugiés et demandeurs d\'asile inscrits dans les écoles publiques, privées et communautaires en Égypte par le biais de son partenaire, Caritas Égypte. En fonction de critères spécifiques fixés par le HCR et annoncés en juin chaque année, vous pourriez être éligible pour des subventions éducatives."),
        "learningA11": MessageLookupByLibrary.simpleMessage(
            "Le HCR fournit un soutien aux enfants ayant des besoins spéciaux par le biais de son partenaire de mise en œuvre, Caritas Égypte, qui fournit des conseils pour évaluer les besoins de l\'enfant, et si nécessaire, peut fournir un soutien supplémentaire tel que trouver une école appropriée pour eux ou des subventions éducatives supplémentaires."),
        "learningA12part1": MessageLookupByLibrary.simpleMessage(
            "L\'enseignement postsecondaire et supérieur commence à l\'âge de 18 ans. En Égypte, l\'enseignement supérieur est actuellement disponible pour les réfugiés syriens, yéménites et soudanais."),
        "learningA12part2": MessageLookupByLibrary.simpleMessage(
            "Les exceptions aux frais universitaires sont déterminées par la nationalité et le type de certificat secondaire par le ministère de l\'Enseignement supérieur. Les exceptions sont renouvelées annuellement."),
        "learningA13": MessageLookupByLibrary.simpleMessage(
            "Non, le HCR ne fournit pas de subventions pour l\'enseignement supérieur. Cependant, le Service allemand d\'échanges universitaires (DAAD) soutient les étudiants inscrits dans les universités gouvernementales par le biais de son initiative Albert Einstein Academic Refugee Initiative (DAFI). Les informations relatives au programme sont annoncées tôt lorsque une nouvelle promotion est acceptée."),
        "learningA14": MessageLookupByLibrary.simpleMessage(
            "C\'est une plateforme en ligne gratuite proposant divers cours dans plusieurs domaines tels que (affaires, marketing, langues, programmation, etc.) proposés par des universités prestigieuses et d\'autres institutions dans le monde entier, et un certificat est délivré à la fin de chaque cours. Coursera pour les réfugiés"),
        "learningA15": MessageLookupByLibrary.simpleMessage(
            "Les réfugiés, les demandeurs d\'asile, ainsi que les Égyptiens disposant d\'une adresse e-mail et d\'un accès Internet peuvent postuler. Ceux qui peuvent s\'inscrire, remplir le formulaire de demande et terminer le programme peuvent également le faire dans l\'un des centres d\'apprentissage communautaires de Maadi et de Nasr City. Cette invitation est actuellement ouverte à 200 réfugiés, demandeurs d\'asile et Égyptiens âgés de 18 à 35 ans uniquement, avec priorité pour l\'inscription."),
        "learningA16": MessageLookupByLibrary.simpleMessage(
            "Oui, certains cours sont traduits en arabe, mais les examens et la plupart des cours sont en anglais."),
        "learningA17part1": MessageLookupByLibrary.simpleMessage(
            "Internet est seulement nécessaire pour télécharger le cours : une fois téléchargé, vous pouvez terminer le cours hors ligne. Comme il existe également une application Coursera, un téléphone portable ou une tablette suffit pour assister, et aucun ordinateur n\'est nécessaire."),
        "learningA17part2": MessageLookupByLibrary.simpleMessage(
            "Vous pouvez également accéder à Internet via les centres d\'apprentissage communautaires du HCR en coopération avec Tear De Zoom à Maadi et Nasr City si vous êtes sélectionné."),
        "learningA18": MessageLookupByLibrary.simpleMessage(
            "Il suffit de remplir le formulaire de candidature à ce lien, et vous recevrez un contact si vous êtes sélectionné : https://qrgo.page.link/YftWz"),
        "learningA19part1": MessageLookupByLibrary.simpleMessage(
            "Centre d\'apprentissage communautaire à Maadi : 01028411101"),
        "learningA19part2": MessageLookupByLibrary.simpleMessage(
            "Centre d\'apprentissage communautaire à Nasr City : 01033680393"),
        "learningA2part1": MessageLookupByLibrary.simpleMessage(
            "Le système éducatif égyptien est divisé en:"),
        "learningA2part2": MessageLookupByLibrary.simpleMessage(
            "L\'éducation de la petite enfance"),
        "learningA2part3": MessageLookupByLibrary.simpleMessage(
            "L\'enseignement primaire (de la première à la sixième année)"),
        "learningA2part4": MessageLookupByLibrary.simpleMessage(
            "L\'enseignement préparatoire (de la première à la troisième préparatoire)"),
        "learningA2part5": MessageLookupByLibrary.simpleMessage(
            "L\'enseignement secondaire (de la première à la troisième secondaire), qui est divisé en deux catégories:"),
        "learningA2part6": MessageLookupByLibrary.simpleMessage(
            "Secondaire général, qui dure trois ans d\'études"),
        "learningA2part7": MessageLookupByLibrary.simpleMessage(
            "Secondaire technique, allant de 3 à 5 ans d\'études."),
        "learningA2part8": MessageLookupByLibrary.simpleMessage(
            "Les étudiants qui réussissent les examens du secondaire pour les trois années peuvent obtenir un diplôme et un certificat de l\'école égyptienne (Certificat de fin d\'études secondaires générales)."),
        "learningA3": MessageLookupByLibrary.simpleMessage(
            "Vous devez vous rendre au Bureau des affaires étudiantes de la zone administrative éducative de votre résidence."),
        "learningA4part1":
            MessageLookupByLibrary.simpleMessage("Permis de résidence valide"),
        "learningA4part2": MessageLookupByLibrary.simpleMessage(
            "Certificat scolaire préalablement reconnu de l\'école que votre enfant a fréquentée avant d\'arriver en Égypte"),
        "learningA4part3": MessageLookupByLibrary.simpleMessage(
            "Si vous n\'avez aucun des éléments ci-dessus, votre enfant doit passer le test de placement de niveau administré par le ministère de l\'Éducation"),
        "learningA5part1": MessageLookupByLibrary.simpleMessage(
            "Les tests de placement de niveau sont des tests courts que les étudiants ayant reçu leur éducation en dehors de l\'Égypte doivent passer pour déterminer l\'année scolaire dans laquelle ils seront inscrits dans le système scolaire égyptien officiel."),
        "learningA5part2": MessageLookupByLibrary.simpleMessage(
            "Les étudiants doivent se rendre au Département des affaires étudiantes et des examens de la zone administrative éducative de leur résidence avec un permis de résidence valide. Le département organisera les tests de placement de niveau."),
        "learningA5part3": MessageLookupByLibrary.simpleMessage(
            "Les tests de placement de niveau sont gratuits."),
        "learningA5part4": MessageLookupByLibrary.simpleMessage(
            "Les étudiants qui réussissent et passent l\'examen reçoivent une lettre d\'admission indiquant l\'âge spécifié de l\'enfant pour l\'inscription. Cette lettre aide les enfants à s\'inscrire dans les écoles."),
        "learningA6": MessageLookupByLibrary.simpleMessage(
            "Le certificat scolaire ne doit pas avoir plus de deux ans. Il doit être soumis aux autorités éducatives qui détermineront s\'il est équivalent ou non aux certificats scolaires égyptiens."),
        "learningA7": MessageLookupByLibrary.simpleMessage(
            "Les personnes inscrites auprès du Haut-Commissariat des Nations unies pour les réfugiés (HCR) qui ne peuvent pas inscrire leurs enfants dans les écoles en raison de l\'absence de l\'un des éléments suivants: permis de résidence, carte d\'identité de réfugié (carte jaune) ou passeports: obtenir une lettre scellée de l\'école confirmant une place pour l\'élève. Avec cette lettre, rendez-vous au département éducatif et faites-la tamponner. Rendez-vous à l\'Administration des passeports et de l\'immigration à Abbasiya, Le Caire. Là, vous obtiendrez un numéro indiquant quand attendre la résidence. En utilisant ce numéro, préparez une copie de votre carte d\'inscription au HCR et une copie de la lettre soumise par l\'école et contactez le ministère pour obtenir une exception jusqu\'à l\'obtention de la résidence. Pour éviter tout retard dans l\'inscription de votre enfant, veuillez compléter les formalités de résidence dès que possible."),
        "learningA8part1": MessageLookupByLibrary.simpleMessage(
            "Les enfants peuvent être inscrits en première année d\'école primaire dans des écoles publiques ou privées jusqu\'à l\'âge de neuf ans, selon leur nationalité. Si l\'élève a plus de neuf ans, il devra s\'inscrire à un cours préparatoire à l\'éducation des adultes avant de s\'inscrire à l\'école. Après avoir réussi avec succès le cours d\'éducation des adultes et obtenu un certificat d\'alphabétisation pour adultes, l\'élève sera inscrit directement en année préparatoire par le biais du système d\'éducation à domicile (Manzil)."),
        "learningA8part2": MessageLookupByLibrary.simpleMessage(
            "L\'élève continuera à étudier via le système d\'éducation à domicile à moins que son âge ne lui permette d\'assister régulièrement à l\'école. Dans ce cas, l\'élève sera inscrit dans une école publique en fonction des disponibilités."),
        "learningA9part1": MessageLookupByLibrary.simpleMessage(
            "Les étudiants doivent se rendre au Bureau des affaires étudiantes de la zone administrative éducative de leur résidence avec les documents suivants:"),
        "learningA9part2": MessageLookupByLibrary.simpleMessage(
            "Dernier certificat d\'études ou preuve de réussite."),
        "learningA9part3": MessageLookupByLibrary.simpleMessage(
            "Documents/Cartes d\'identité du HCR."),
        "learningA9part4":
            MessageLookupByLibrary.simpleMessage("Deux photos d\'identité."),
        "learningA9part5": MessageLookupByLibrary.simpleMessage(
            "Le département les référera à l\'école la plus proche de leur résidence, où ils seront inscrits, mais ils étudieront de chez eux et passeront les examens de mi-année et de fin d\'année à l\'école."),
        "learningQ1": MessageLookupByLibrary.simpleMessage(
