        "residence1": MessageLookupByLibrary.simpleMessage(
            "Pour obtenir ou renouveler une carte de permis de résidence, vous devez suivre ces instructions :"),
        "residence10": MessageLookupByLibrary.simpleMessage(
            "- Toutes les cartes d\'inscription émises par la Commission pour les affaires des réfugiés pour les membres de la famille et les personnes à charge enregistrés avec vous en Égypte"),
        "residence12": MessageLookupByLibrary.simpleMessage(
            "- Passeport original pour les membres de la famille et les personnes à charge enregistrés avec vous en Égypte"),
        "residence13": MessageLookupByLibrary.simpleMessage(
            "- Copies du document d\'inscription de la Commission et du/des passeport(s)"),
        "residence14": MessageLookupByLibrary.simpleMessage(
            "- Le numéro de référence obtenu auprès du bureau de la commission"),
        "residence15": MessageLookupByLibrary.simpleMessage(
            "- Deux photos d\'identité de format passeport. Pas besoin de photos des personnes à charge sauf s\'ils ont plus de 12 ans et possèdent une carte d\'enregistrement distincte de la commission"),
        "residence16": MessageLookupByLibrary.simpleMessage(
            "Dois-je payer des frais pour le permis de séjour ?"),
        "residence17": MessageLookupByLibrary.simpleMessage(
            "Oui, vous devrez payer des frais de 100 livres égyptiennes pour l\'émission de la carte de permis de résidence + des frais administratifs pour la banque pour chaque membre de la famille âgé de 12 ans ou plus à la banque située dans le bâtiment lors de la soumission de votre demande à l\'unité de résidence"),
        "residence18": MessageLookupByLibrary.simpleMessage(
            "Comment puis-je accéder à l\'Administration des passeports et de l\'immigration ?"),
        "residence19": MessageLookupByLibrary.simpleMessage(
            "Le siège de l\'administration est situé au 417, rue Ramses à Abbasia et est facilement accessible en transports en commun en suivant ces instructions :"),
        "residence2": MessageLookupByLibrary.simpleMessage(
            "Les réfugiés et demandeurs d\'asile qui sont programmés pour renouveler ou obtenir leurs cartes de commission dans les bureaux de la commission et qui ont reçu des messages de la commission à cet effet, obtiennent le numéro de résidence de référence du ministère des Affaires étrangères lors de leur entretien dans les bureaux de la commission et communiquent directement avec le bureau de la résidence à la Direction générale de l\'immigration, des passeports et de la nationalité à Abbasia à leur rendez-vous prévu."),
        "residence20": MessageLookupByLibrary.simpleMessage(
            "Pour les réfugiés résidant dans le Grand Caire :"),
        "residence21": MessageLookupByLibrary.simpleMessage(
            "Métro : La station la plus proche du nouveau siège est la station Abbasia (Ligne verte, Ligne Imbaba - Aéroport). Après être sorti de la station de métro, l\'administration se trouve à cinq minutes à pied."),
        "residence22": MessageLookupByLibrary.simpleMessage(
            "Pour les réfugiés résidant dans d\'autres gouvernorats :"),
        "residence23": MessageLookupByLibrary.simpleMessage(
            "Gare de train Ramsès : Vous pouvez prendre le train/les transports en commun depuis n\'importe quel gouvernorat jusqu\'à la gare de Ramsès. À votre arrivée à la gare, transférez-vous à la station de métro Al Shohada et descendez à la station de métro Al Ataba où vous passerez à la Ligne verte du métro (Imbaba - Aéroport) et descendez à la station Abbasia. Après être sorti de la station de métro, l\'administration se trouve à cinq minutes à pied."),
        "residence3": MessageLookupByLibrary.simpleMessage(
            "Quant aux réfugiés et demandeurs d\'asile titulaires de cartes valides, ils peuvent obtenir le numéro de résidence de référence du ministère des Affaires étrangères et la date de demande auprès des bureaux de Caritas Égypte aux adresses suivantes :"),
        "residence4": MessageLookupByLibrary.simpleMessage(
            "- Octobre : Bâtiment 8/48 - Huitième quartier - Deuxième quartier Tous les jours sauf le samedi et le dimanche : de 8h30 à 15h30"),
        "residence5": MessageLookupByLibrary.simpleMessage(
            "- Cité Nasr : 30, rue Sibawi El Masry, à côté de la rue Anwar El Mofty, derrière le département de la circulation de la cité Nasr Tous les jours sauf le samedi et le dimanche : de 8h30 à 15h30"),
        "residence6": MessageLookupByLibrary.simpleMessage(
            "- Alexandrie : 26, rue Talaat Naaman, gare de Ramel, troisième étage Tous les jours sauf le vendredi et le dimanche : de 15h30 à 20h30"),
        "residence7": MessageLookupByLibrary.simpleMessage(
            "- Damiette : 81/21 Premier quartier, premier district, en face de l\'Institut de tourisme et d\'hôtellerie de la nouvelle Damiette Tous les jours sauf le vendredi et le samedi : de 14h30 à 19h30"),
        "residence8": MessageLookupByLibrary.simpleMessage(
            "Remarque : Vous devez apporter votre carte valide lorsque vous vous rendez dans les bureaux de Caritas et vous assurer que votre carte de commission est valide pendant au moins un mois à votre rendez-vous prévu devant les bureaux de contact à la Direction générale de l\'immigration, des passeports et de la nationalité à Abbasia."),
        "residence9": MessageLookupByLibrary.simpleMessage(
            "Quels documents dois-je apporter ?"),
        "restAndCafes":
            MessageLookupByLibrary.simpleMessage("Restaurants et cafés"),
        "restuarants": MessageLookupByLibrary.simpleMessage("Restaurants"),
        "rights": MessageLookupByLibrary.simpleMessage("Droits"),
        "rightsA1": MessageLookupByLibrary.simpleMessage(
            "Les différents droits dont bénéficient les demandeurs d\'asile et les réfugiés parce qu\'ils demandent l\'asile ou ont obtenu une protection en tant que réfugiés, et dont l\'État hôte est responsable de garantir. Ces droits sont consacrés dans la Convention sur les réfugiés et les traités relatifs aux droits de l\'homme. Ces droits portent sur la possibilité de rester dans le pays d\'accueil et de ne pas être renvoyés dans leur pays d\'origine (non-refoulement, par exemple) et comprennent l\'éducation, les soins de santé, le logement, le travail et la famille, entre autres."),
        "rightsA2": MessageLookupByLibrary.simpleMessage(
            "Il s\'agit d\'une compilation du droit international coutumier et des instruments internationaux qui fixent les normes nécessaires à la protection des réfugiés. La Convention de 1951 et son Protocole de 1967 relatifs au statut des réfugiés sont les pierres angulaires du droit d\'asile. Le droit d\'asile et le droit international des droits de l\'homme se complètent mutuellement, de même que le droit international humanitaire."),
        "rightsA3": MessageLookupByLibrary.simpleMessage(
            "Il s\'agit d\'un droit important pour les réfugiés, les demandeurs d\'asile et d\'autres personnes qui craignent pour leur vie ou leur liberté. Ces individus ont le droit de ne pas être renvoyés sous quelque forme que ce soit par le pays hôte vers leur pays d\'origine ou vers tout autre pays où ils pourraient être exposés à des dangers ou à des préjudices. Ce droit, connu sous le nom de principe de non-refoulement, est consacré dans la Convention sur les réfugiés et d\'autres traités relatifs aux droits de l\'homme. Il fait également partie de ce qu\'on appelle le droit international coutumier, et par conséquent, doit être assuré par tous les pays."),
        "rightsA4": MessageLookupByLibrary.simpleMessage(
            "La protection des réfugiés comprend toutes les activités visant à assurer le respect total des droits des réfugiés. La protection consiste à fournir un environnement propice au respect de la personne humaine et à prévenir ou à atténuer les effets directs d\'un certain schéma de mauvais traitements, et à rétablir des conditions de vie dignes par le biais de compensations et de réhabilitations."),
        "rightsA5": MessageLookupByLibrary.simpleMessage(
            "Oui, les réfugiés ont des droits de l\'homme. Les droits de l\'homme sont généralement compris comme des droits inaliénables que toute personne mérite simplement en tant qu\'être humain. Ils sont fondés sur les principes fondamentaux de l\'universalité, de l\'égalité et de la non-discrimination, et sont consacrés dans les traités, le droit international coutumier, les lois nationales et d\'autres normes qui les définissent et contribuent à garantir leur pleine jouissance. Les droits de l\'homme s\'appliquent à toutes les personnes, y compris à toutes les personnes relevant du mandat du HCR."),
        "rightsA6part1": MessageLookupByLibrary.simpleMessage(
            "En tant que réfugié ou personne apatride dans l\'un des États parties à la Convention de 1951 sur les réfugiés ou à la Convention de 1954 relative au statut des apatrides, vous avez le droit d\'obtenir un \'Document de voyage de la Convention\' qui est délivré pour remplacer votre passeport national."),
        "rightsA6part2": MessageLookupByLibrary.simpleMessage(
            "En tant que réfugié, voyager avec un \'Document de voyage de la Convention\' est plus sûr que de voyager avec un passeport national, car vous êtes protégé contre le renvoi forcé vers votre pays d\'origine."),
        "rightsA6part3": MessageLookupByLibrary.simpleMessage(
            "Pratiquement, tous les pays n\'émettent pas de Documents de voyage de la Convention malgré leur obligation de le faire. Certains pays délivrent d\'autres documents de voyage aux réfugiés et aux apatrides, tels que des passeports pour étrangers ou des documents d\'identité spéciaux pour les voyages."),
        "rightsA6part4": MessageLookupByLibrary.simpleMessage(
            "Dans certains pays, le HCR peut vous aider à obtenir un Document de voyage d\'urgence auprès du Comité international de la Croix-Rouge lorsque vous n\'avez pas d\'autres options. Ce document n\'est valable que pour un seul voyage."),
        "rightsQ1": MessageLookupByLibrary.simpleMessage(
            "Quels sont les droits des réfugiés ?"),
        "rightsQ2": MessageLookupByLibrary.simpleMessage(
            "Qu\'est-ce que la loi sur l\'asile ?"),
